import Vue from 'vue'
Vue.component("signin", () => import("/media/itsd/ITSD/Projects/test/docs/.vuepress/components/signin.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-ea339e47062ff",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/media/itsd/ITSD/Projects/test/docs/README.md").then(comp => {
        Vue.component("v-ea339e47062ff", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-7bb4daa96b6bc",
    path: "/about/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/media/itsd/ITSD/Projects/test/docs/about/index.md").then(comp => {
        Vue.component("v-7bb4daa96b6bc", comp.default)
        next()
      })
    }
  },
  {
    path: "/about/index.html",
    redirect: "/about/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
